<html xmlns:fo="http://www.w3.org/1999/XSL/Format">
<head>
<META http-equiv="Content-Type" content="text/html; charset=UTF-8">
<title>Performance Testing Report</title>
<link type="text/css" rel="stylesheet" href="style.css">
</head>
<body>
<div class="divHeader">Push messages</div>
<div style="width: 100%; height: 20px;" id="report.shared">
<div id="statistics_summary_title" class="h1" style="float:left">Shared containers</div>
</div>
<div align="center" class="wrapper shared">
<div align="center">
<table>
<tr>
<th width="10%">Min</th><th width="10%">Avg</th><th width="10%">Max</th><th width="10%">Hits</th><th width="10%">Err</th><th width="10%">% of Err</th><th width="10%">Med</th><th width="10%">Avg-90%</th><th width="10%">Std Dev</th><th width="10%">SLA Profile</th>
</tr>
<tr>
<td class="line2" colspan="10">Empty list</td>
</tr>
</table>
</div>
</div>
<div style="width: 100%; height: 20px;" class="user-tableheader" id="VirtualUser">
<div id="statistics_summary_title" class="h1" style="float:left">VirtualUser</div>
</div>
<div align="center" class="wrapper">
<div align="center">
<table>
<tr>
<th width="10%">Min</th><th width="10%">Avg</th><th width="10%">Max</th><th width="10%">Hits</th><th width="10%">Err</th><th width="10%">% of Err</th><th width="10%">Med</th><th width="10%">Avg-90%</th><th width="10%">Std Dev</th><th width="10%">SLA Profile</th>
</tr>
<tr>
<td class="line2" colspan="10">Empty list</td>
</tr>
</table>
</div>
</div>
</body>
</html>
